import React from 'react';
import header from './components/header';
import taskbar from './components/taskbar';
import tasklist from './components/tasklist';

class App extends React.Component{
    render(){
        return(
            <div>
                <header />
                <taskbar />
                <tasklist />
            </div>
        );
    };
};

export default App;
